import {
    BrowserRouter,
    Route,
    Routes,
} from "react-router-dom";
import Header from "../non-components/Header";
import Footer from "../non-components/Footer";
import BookForm from "./BookForm";
import BookListRender from "./BookListRender";
import IndividualBook from "./IndividualBook";
import UserLogin from "./UserLogin";

function App() {

    return (
        // <div>
        //     <Header />
        //     <BrowserRouter>
        //         <Routes>
        //             <Route path="/" element={<BookListRender />} />
        //             <Route path="/IndividualBook" name="IndividualBook" element={<IndividualBook />} />
        //         </Routes>
        //     </BrowserRouter>
        //     <Footer />
        // </div>
        // <UserLogin/>
        <form>
            {/* <!-- Email input --> */}
            <div className="form-outline mb-4">
                <input type="email" id="form2Example1" className="form-control" />
                <label className="form-label" for="form2Example1">Email address</label>
            </div>

            {/* <!-- Password input --> */}
            <div className="form-outline mb-4">
                <input type="password" id="form2Example2" className="form-control" />
                <label className="form-label" for="form2Example2">Password</label>
            </div>

            {/* <!-- 2 column grid layout for inline styling --> */}
            <div className="row mb-4">
                <div className="col d-flex justify-content-center">
                    {/* <!-- Checkbox --> */}
                    <div className="form-check">
                        <input className="form-check-input" type="checkbox" value="" id="form2Example31" checked />
                        <label className="form-check-label" for="form2Example31"> Remember me </label>
                    </div>
                </div>

                <div className="col">
                    {/* <!-- Simple link --> */}
                    <a href="#!">Forgot password?</a>
                </div>
            </div>

            {/* <!-- Submit button --> */}
            <button type="button" className="btn btn-primary btn-block mb-4">Sign in</button>

            {/* <!-- Register buttons --> */}
            <div className="text-center">
                <p>Not a member? <a href="#!">Register</a></p>
                <p>or sign up with:</p>
                <button type="button" className="btn btn-link btn-floating mx-1">
                    <i className="fab fa-facebook-f"></i>
                </button>

                <button type="button" className="btn btn-link btn-floating mx-1">
                    <i className="fab fa-google"></i>
                </button>

                <button type="button" className="btn btn-link btn-floating mx-1">
                    <i className="fab fa-twitter"></i>
                </button>

                <button type="button" className="btn btn-link btn-floating mx-1">
                    <i className="fab fa-github"></i>
                </button>
            </div>
        </form>
    );
}

export default App;
